<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Route95 - We Come to You</title>
<link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=Montserrat:wght@400;600;700;800&display=swap" rel="stylesheet">
<style>
  * { margin: 0; padding: 0; box-sizing: border-box; }

  body {
    display: flex;
    justify-content: center;
    align-items: center;
    min-height: 100vh;
    background: #1a1a2e;
    font-family: 'Montserrat', sans-serif;
  }

  .post {
    width: 1080px;
    height: 1080px;
    position: relative;
    overflow: hidden;
    background: linear-gradient(160deg, #0a0e1a 0%, #0d1b2a 30%, #0a1628 60%, #071020 100%);
  }

  /* Ambient glow effects */
  .post::before {
    content: '';
    position: absolute;
    top: -200px;
    right: -200px;
    width: 600px;
    height: 600px;
    background: radial-gradient(circle, rgba(30, 90, 180, 0.15) 0%, transparent 70%);
    z-index: 0;
  }

  .post::after {
    content: '';
    position: absolute;
    bottom: -100px;
    left: -100px;
    width: 500px;
    height: 500px;
    background: radial-gradient(circle, rgba(20, 80, 200, 0.1) 0%, transparent 70%);
    z-index: 0;
  }

  /* Subtle grid pattern */
  .grid-overlay {
    position: absolute;
    inset: 0;
    background-image: 
      linear-gradient(rgba(255,255,255,0.02) 1px, transparent 1px),
      linear-gradient(90deg, rgba(255,255,255,0.02) 1px, transparent 1px);
    background-size: 60px 60px;
    z-index: 1;
  }

  /* Water droplet accents */
  .droplet {
    position: absolute;
    border-radius: 50%;
    background: radial-gradient(circle at 30% 30%, rgba(100, 180, 255, 0.3), rgba(30, 100, 200, 0.1));
    border: 1px solid rgba(100, 180, 255, 0.15);
    z-index: 1;
  }
  .droplet-1 { width: 12px; height: 12px; top: 180px; right: 120px; }
  .droplet-2 { width: 8px; height: 8px; top: 220px; right: 80px; }
  .droplet-3 { width: 15px; height: 15px; top: 160px; right: 180px; }
  .droplet-4 { width: 6px; height: 6px; bottom: 300px; left: 100px; }
  .droplet-5 { width: 10px; height: 10px; bottom: 280px; left: 160px; }
  .droplet-6 { width: 8px; height: 8px; top: 400px; right: 60px; }

  .content {
    position: relative;
    z-index: 2;
    width: 100%;
    height: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    padding: 60px;
  }

  .logo-container {
    width: 420px;
    height: 420px;
    display: flex;
    align-items: center;
    justify-content: center;
    margin-bottom: 20px;
    position: relative;
  }

  .logo-container::before {
    content: '';
    position: absolute;
    inset: -20px;
    background: radial-gradient(circle, rgba(30, 90, 200, 0.08) 0%, transparent 70%);
    border-radius: 50%;
  }

  .logo-container img {
    width: 100%;
    height: 100%;
    object-fit: contain;
    filter: drop-shadow(0 0 40px rgba(30, 100, 220, 0.3));
  }

  .headline {
    font-family: 'Bebas Neue', sans-serif;
    font-size: 72px;
    color: #ffffff;
    letter-spacing: 8px;
    text-align: center;
    line-height: 1;
    margin-bottom: 8px;
    text-shadow: 0 0 60px rgba(50, 120, 220, 0.4);
  }

  .headline .accent {
    color: #4da3ff;
  }

  .divider {
    width: 120px;
    height: 2px;
    background: linear-gradient(90deg, transparent, #4da3ff, transparent);
    margin: 16px auto;
  }

  .tagline {
    font-family: 'Montserrat', sans-serif;
    font-size: 18px;
    font-weight: 600;
    color: rgba(255, 255, 255, 0.7);
    letter-spacing: 6px;
    text-transform: uppercase;
    text-align: center;
    margin-bottom: 36px;
  }

  .cta-box {
    display: flex;
    align-items: center;
    gap: 30px;
    padding: 20px 40px;
    border: 1px solid rgba(77, 163, 255, 0.25);
    border-radius: 8px;
    background: rgba(20, 60, 120, 0.15);
    backdrop-filter: blur(10px);
  }

  .cta-item {
    text-align: center;
  }

  .cta-label {
    font-size: 11px;
    font-weight: 700;
    color: #4da3ff;
    letter-spacing: 3px;
    text-transform: uppercase;
    margin-bottom: 4px;
  }

  .cta-value {
    font-size: 16px;
    font-weight: 600;
    color: #ffffff;
    letter-spacing: 1px;
  }

  .cta-separator {
    width: 1px;
    height: 40px;
    background: rgba(77, 163, 255, 0.3);
  }

  /* Corner accents */
  .corner {
    position: absolute;
    width: 40px;
    height: 40px;
    z-index: 2;
  }
  .corner-tl { top: 30px; left: 30px; border-top: 2px solid rgba(77,163,255,0.3); border-left: 2px solid rgba(77,163,255,0.3); }
  .corner-tr { top: 30px; right: 30px; border-top: 2px solid rgba(77,163,255,0.3); border-right: 2px solid rgba(77,163,255,0.3); }
  .corner-bl { bottom: 30px; left: 30px; border-bottom: 2px solid rgba(77,163,255,0.3); border-left: 2px solid rgba(77,163,255,0.3); }
  .corner-br { bottom: 30px; right: 30px; border-bottom: 2px solid rgba(77,163,255,0.3); border-right: 2px solid rgba(77,163,255,0.3); }

  .location-badge {
    position: absolute;
    bottom: 45px;
    font-size: 12px;
    font-weight: 600;
    color: rgba(255,255,255,0.35);
    letter-spacing: 4px;
    text-transform: uppercase;
    z-index: 2;
  }
</style>
</head>
